    }
    render() {
        return (
            <AppBar position = "fixed">
                <Container fixed>
                    <Toolbar>
                        <IconButton edge ="start" color ="inherit" aria-label ="menu">
                            <MenuIcon />
                        </IconButton>
                        <Typography>BookStore</Typography>
                    </Toolbar>
                </Container>
            </AppBar>
        )
    }
}
